import { useState } from "react"

function State(){
  const[name,setName]=useState("")
  const[email,setEmail]=useState("")
  const[pswd,setPswd]=useState("")
  const[cpswd,setCpswd]=useState("")

  const Name=(e)=>{
    setName(e.target.value)
  }
  const Email=(e)=>{
    setEmail(e.target.value)
  }
  const Pswd=(e)=>{
    setPswd(e.target.value)
  }
  const Cpswd=(e)=>{
    setCpswd(e.target.value)
  }
  const Submit=()=>{
    if(Name.length<=5){
        alert("Mustr be enter > 6 character")
    }
    else if(pswd != cpswd){
        alert("password does not match..!")
    }
    else{
        alert("Succes")
    }
}




  return(
    <div>
    <fieldset onSubmit={Submit}>
      <form>
        <input value={Name} type="text" placeholder="Enter Full Name" required onChange={Name}></input>
        <input  value={Email} type="email" placeholder="enter email" required onChange={Email}> </input>
        <input value={Pswd} type="password" placeholder="password" required onChange={Pswd} ></input>
        <input value={Cpswd} type="password" placeholder="confirm password" required onChange={Cpswd} ></input>
        <input type="submit"></input>
      </form>
    </fieldset>
    </div>
  )
}
export default State;
